@inferus.us long sleeve 

@inferus.us is giving away one “No Trust” baseball long sleeve before the release of their new collection on the 18th. To win this item, just follow these two easy steps:

- Make sure you are following @inferus.us
- Tag two friends in the comment section of the most recent post and list your size 

INFERUS will be selecting a winner on their story the 17th at 12:00 pm PST. Additionally, the shirt comes with a free Inferus tote. 

Good luck

